import React from "react";
import BlocksRow from "./BlocksRow";

function Board () {
    const board = []
    for (let rows = 0; rows < 8; rows++) {
        board.push(<BlocksRow rows = {rows}/>)        
    }
    
    return (
        <div>
            <table className="center">
                {board}
            </table>
        </div>
    )
    
}

export default Board
